import { VideosBody } from '../Helper/VideosBody';

import styles from './Videos.module.css'

const Videos = () => {
    console.log(VideosBody)
    return (
        <div className={styles.videoCont}>

            {VideosBody.map(vids => {
                return (
                <ul 
                className={styles.ulVid} 
                key={vids.id} 
                alt={vids.name} 
                muted
                onMouseOver={e => e.target.play()}
                onMouseOut={e => e.target.pause()}

                type={vids.type}
                >
                    <li className={styles.liVid} background-image={vids.src}></li>
                </ul>)
            })}

        </div>
    )
};

export default Videos;
